import { StatusBar } from 'expo-status-bar';
import { NativeBaseProvider } from 'native-base';
import Home from './src/Home'


export default function App() {

  return (
    <NativeBaseProvider>
      <Box bg='Secondary.500'>
        <Home/>
      </Box> 
      <StatusBar style="auto" />
    </NativeBaseProvider>
  );
}
